@ClientHandling.type: #CLIENT_DEPENDENT
@AbapCatalog.deliveryClass: #APPLICATION_DATA
@AccessControl.authorizationCheck: #NOT_REQUIRED
@EndUserText.label: 'NFe NFP Reference'
define table entity /EXEDMINB/T_NFeNFPRefer
{
  key Id         : abap.char(44); // FK para Header (chNFe)
  key IdRefer    : abap.int4;     // FK para linha em NFeReferences
  key IdNFPRefer : abap.int4;     // Sequência da referência NFP

      cUF        : abap.char(2);  // Código da UF (IBGE)
      AAMM       : abap.char(4);  // Ano e mês da emissão (AAMM)
      CNPJ       : abap.char(14); // CNPJ do emitente (se houver)
      CPF        : abap.char(11); // CPF do produtor rural
      IE         : abap.char(14); // Inscrição Estadual
      mod        : abap.char(2);  // Modelo do documento fiscal
      serie      : abap.char(3);  // Série
      nNF        : abap.numc(9);  // Número da NF
}
